// src/components/ContactPage/LocationInfoSection.js
import React from 'react';
import './ContactPage.css';

function LocationInfoSection() {
  return (
    <section className="location-info-section">
      <h2>Our Location</h2>
      <div className="address-block">
        <p>Paulinenstra√üe 50</p>
        <p>70178, Stuttgart</p>
        <p>Phone: +49 30 12345678</p>
        <p>Email: hallo@mediaflow.de</p>
      </div>
      <div className="map-embed">
        <iframe
          src="https://www.google.de/maps/place/DHBW+Stuttgart+-+Fakult%C3%A4t+Wirtschaft/@48.7733697,9.1704939,20.1z/data=!4m6!3m5!1s0x4799dbb3d78fef99:0x31d0d5a752c2215!8m2!3d48.7733806!4d9.1705173!16s%2Fg%2F11tc20zk30?entry=ttu&g_ep=EgoyMDI0MDkxMS4wIKXMDSoASAFQAw%3D%3D"
          width="600"
          height="450"
          style={{ border: 0 }}
          allowFullScreen=""
          loading="lazy"
          title="Our Location"
        ></iframe>
      </div>
    </section>
  );
}

export default LocationInfoSection;
